    # Sort by id, timestamp to correctly imput test values
    test = test.sort_values(by=['id','timestamp'])
    test["nbnulls"]=test.isnull().sum(axis=1)
    
    # Exponential weighted moving average
    ewma_values = raw_last_values.copy()
    #ewma_values.loc[:, col] = ewma_values.groupby("id")[col].apply(pd.ewma, span=rolling_window)
    ewma_values.loc[:, col] = ewma_values.loc[:, col].ewm(span=rolling_window, ignore_na=True).mean()
    
    ewma_last_values = ewma_values[ewma_values["timestamp"] == previous_timestamp]
    
    # Restrict to common ID for imputing
    indexcommun = list(set(ewma_last_values.id) & set(test.id))
    # Reset index to match test data index for the "fillna" method
    ewma_last_values = ewma_last_values[ewma_last_values.id.isin(indexcommun)].reset_index(drop=True)
    
    # Impute test missing data with EWMA
    test[test.id.isin(indexcommun)] = test[test.id.isin(indexcommun)].fillna(ewma_last_values)
    
    # Delete oldest timestamp
    # And add new values for next imputing 
    raw_last_values = raw_last_values[raw_last_values["timestamp"] != previous_timestamp - rolling_window + 1]
    raw_last_values = raw_last_values.append(test).sort_values(by=["id", "timestamp"])
    
